import './App.css';
import { Routes, Route} from "react-router-dom"
import LandingPage from '../src/Components/LandingPage/LandingPage';
import HomePage from './Components/HomePage/HomePage';
import NavBar from './Components/NavBar/NavBar'
import axios from 'axios';
import { useState } from 'react';

function App() {
const [doggies, setDoggies] = useState([])

const onSearch = async (id) => {
  try {
     const { data } = await axios(`https://api.thedogapi.com/v1/breeds/${id}`);

     if(data.name) {
        setDoggies((oldDoggies) => [...oldDoggies, data]);
     };

  } catch (error) {
     alert('¡No hay personajes con este ID!');
  }
};


  return (
    <div className='app'>
      <Routes>
      <Route path='/' element={<NavBar onSearch={onSearch}/>} />
      <Route path='/' element={<LandingPage doggies={doggies} />} />
      <Route path='/homePage' element={<HomePage/>}/>
      </Routes>

    </div>
  );
}

export default App;
